import React from 'react';
import 'antd/dist/antd.css';
import { Layout, Menu,Button } from 'antd';
import {WrappedSigin }from "../Siginin/Siginin"
import './Navbar.css'
const { Header } = Layout;
export default class Navbar extends React.Component {
  state = { visible: false };

  showDrawer = () => {
    this.setState({
      visible: true,
    });
  };

  onClose = () => {
    this.setState({
      visible: false,
    });
  };
  render()
{
  let {visible}=this.state
  return (
    <Layout className="navbar">
    <Header className="main-header">
      <Menu
        mode="horizontal"
        style={{ lineHeight: '65px' }}
      > 
        <Menu.Item key="1">
        <Button type="primary" onClick={this.showDrawer} shape="rounded" ghost>
          Signup
        </Button>
        </Menu.Item>
        <Menu.Item key="2">  
        <Button type="primary" shape="rounded" nClick={this.showDrawer}>
         Login
        </Button></Menu.Item>
      </Menu>
    </Header>
    <WrappedSigin
      visible={visible}
      onClose={this.onClose}
    />

  </Layout>
  )
}
}
